/// <summary>
/// Indicates whether the current record is reserved by an invoice line.
/// </summary>
/// <param name="_excludeParmId">
/// The <c>ParmId</c> value not to consider when it is determined whether to reserve this
/// <c>VendPackingSlipTrans</c> table.
/// </param>
/// <returns>
/// true if the current record is reserved; otherwise, false.
/// </returns>
public boolean isReserved(ParmId _excludeParmId)
{
    VendInvoiceInfoSubLine  vendInvoiceInfoSubLine;
    VendInvoiceInfoTable    vendInvoiceInfoTable;
    VendInvoiceInfoLine     vendInvoiceInfoLine;

    select firstonly RecId from vendInvoiceInfoSubLine
            where
                vendInvoiceInfoSubLine.JournalRefTableId == this.TableId &&
                vendInvoiceInfoSubLine.JournalRefRecId == this.RecId &&
                vendInvoiceInfoSubLine.ParmId != _excludeParmId
        join RecId from vendInvoiceInfoLine
            where   vendInvoiceInfoLine.RecId == vendInvoiceInfoSubLine.LineRefRecId
        join ParmJobStatus from vendInvoiceInfoTable
            where   vendInvoiceInfoTable.ParmId == vendInvoiceInfoLine.ParmId &&
                    vendInvoiceInfoTable.TableRefId == vendInvoiceInfoLine.TableRefId;

    if (vendInvoiceInfoSubLine.RecId != 0)
    {
        return vendInvoiceInfoTable.ParmJobStatus == ParmJobStatus::Executed ? false : true;
    }

    return false;
}

