/// <summary>
/// Returns the invoiced quantity that is not posted in the catch weight unit of measure for the
/// current record.
/// </summary>
/// <param name="_excludeParmId">
/// A <c>parmId</c> value that identifies the records that are to be excluded from the calculation;
/// optional.
/// </param>
/// <returns>
/// The total invoiced quantity that is not posted for the current packing slip that is expressed in
/// catch weight unit of measure.
/// </returns>
public display PdsCWUnpostedInvoiceQty pdsCWUnpostedInvoiceQty(ParmId _excludeParmId = '')
{
    return this.pdsCWUnpostedInvoiceQtyServer(_excludeParmId);
}

private PdsCWUnpostedInvoiceQty pdsCWUnpostedInvoiceQtyServer(ParmId _excludeParmId = '')
{
    VendInvoiceInfoTable    parmTable;
    VendInvoiceInfoLine     parmLine;
    VendInvoiceInfoSubLine  parmSubLine;

    select sum(PdsCWInventNow) from parmSubLine
        where   parmSubLine.JournalRefTableId == this.TableId
            &&  parmSubLine.JournalRefRecId == this.RecId
            && (!_excludeParmId || parmSubLine.ParmId != _excludeParmId)
        exists join parmLine
            where parmLine.RecId == parmSubLine.LineRefRecId
        exists join parmTable
            where   parmTable.ParmId == parmLine.ParmId
                &&  parmTable.TableRefId == parmLine.TableRefId
                && (parmTable.ParmJobStatus == ParmJobStatus::Waiting
                ||  parmTable.ParmJobStatus == ParmJobStatus::ContainErrors);

    return parmSubLine.PdsCWInventNow;
}

