internal container calculateRemainingFinancialQuantities(ParmId _excludeParmId = '')
{
    PurchQty invoicedPurchQuantity;
    InventQty invoicedInventQuantity;
    PdsCWInventQty pdsCWinvoicedInventQuantity;

    UnpostedInvoicePurchQty unpostedInvoicePurchQuantity;
    UnpostedInvoiceInventQty unpostedInvoiceInventQuantity;
    PdsCWUnpostedInvoiceQty pdsCWUnpostedInvoiceQuantity;

    [invoicedPurchQuantity, invoicedInventQuantity, pdsCWinvoicedInventQuantity] = VendInvoicePackingSlipQuantityMatch::purchInventoryQuantityMatched(this.SourceDocumentLine);
    [unpostedInvoicePurchQuantity, unpostedInvoiceInventQuantity, pdsCWUnpostedInvoiceQuantity] = this.unpostedInvoiceQty(_excludeParmId);

    return [this.Qty - invoicedPurchQuantity - unpostedInvoicePurchQuantity,
        this.InventQty - invoicedInventQuantity - unpostedInvoiceInventQuantity,
        this.PdsCWQty - pdsCWinvoicedInventQuantity - pdsCWUnpostedInvoiceQuantity];
}

