/// <summary>
/// Returns the unposted invoiced quantity in inventory unit of measure for the current record.
/// </summary>
/// <param name = "_excludeParmId">A <c>parmId</c> value that identifies the records that are to be excluded from the calculation; optional.</param>
/// <returns>The total unposted invoiced quantity for the current packing slip expressed in inventory unit of measure.</returns>
protected UnpostedInvoiceInventQty unpostedInvoiceInventQtyServer(ParmId _excludeParmId = '')
{
    // <GEERU><GEEPL>
    #ISOCountryRegionCodes
    // </GEERU></GEEPL>
    VendInvoiceInfoTable    parmTable;
    VendInvoiceInfoLine     parmLine;
    VendInvoiceInfoSubLine  parmSubLine;

    // Total the quantity from active invoices first
    select sum(InventNow) from parmSubLine
        where parmSubLine.JournalRefTableId == this.TableId &&
              parmSubLine.JournalRefRecId == this.RecId &&
              (!_excludeParmId || parmSubLine.ParmId != _excludeParmId)
        exists join parmLine
            where parmLine.RecId == parmSubLine.LineRefRecId
        exists join parmTable
            where parmTable.ParmId == parmLine.ParmId &&
                  parmTable.TableRefId == parmLine.TableRefId &&
                  (parmTable.ParmJobStatus == ParmJobStatus::Waiting ||
                   parmTable.ParmJobStatus == ParmJobStatus::ContainErrors);

    return parmSubLine.InventNow;
}

/// <summary>
/// Returns the unposted invoiced quantity in purchasing unit of measure for the current record.
/// </summary>
/// <param name="_excludeParmId">A <c>parmId</c> value that identifies the records that are to be excluded from the calculation; optional.</param>
/// <returns>The total unposted invoiced quantity for the current packing slip expressed in purchasing unit of measure.</returns>
public display UnpostedInvoicePurchQty unpostedInvoicePurchQty(ParmId _excludeParmId = '')
{
    return this.unpostedInvoicePurchQtyServer(_excludeParmId);
}

/// <summary>
/// Returns the unposted invoiced quantity in purchasing unit of measure for the current record.
/// </summary>
/// <param name = "_excludeParmId">A <c>parmId</c> value that identifies the records that are to be excluded from the calculation; optional.</param>
/// <returns>The total unposted invoiced quantity for the current packing slip expressed in purchasing unit of measure.</returns>
protected UnpostedInvoicePurchQty unpostedInvoicePurchQtyServer(ParmId _excludeParmId = '')
{
    VendInvoiceInfoTable    parmTable;
    VendInvoiceInfoLine     parmLine;
    VendInvoiceInfoSubLine  parmSubLine;

    select sum(ReceiveNow) from parmSubLine
        where parmSubLine.JournalRefTableId == this.TableId &&
              parmSubLine.JournalRefRecId == this.RecId &&
              (!_excludeParmId || parmSubLine.ParmId != _excludeParmId)
        exists join parmLine
            where parmLine.RecId == parmSubLine.LineRefRecId
        exists join parmTable
            where parmTable.ParmId == parmLine.ParmId &&
                  parmTable.TableRefId == parmLine.TableRefId &&
                  (parmTable.ParmJobStatus == ParmJobStatus::Waiting ||
                   parmTable.ParmJobStatus == ParmJobStatus::ContainErrors);

    return parmSubLine.ReceiveNow;
}

internal container unpostedInvoiceQty(ParmId _excludeParmId = '')
{
    VendInvoiceInfoTable    parmTable;
    VendInvoiceInfoLine     parmLine;
    VendInvoiceInfoSubLine  parmSubLine;

    select sum(ReceiveNow), sum(InventNow), sum(PdsCWInventNow) from parmSubLine
        where parmSubLine.JournalRefTableId == this.TableId &&
              parmSubLine.JournalRefRecId == this.RecId &&
              (!_excludeParmId || parmSubLine.ParmId != _excludeParmId)
        exists join parmLine
            where parmLine.RecId == parmSubLine.LineRefRecId
        exists join parmTable
            where parmTable.ParmId == parmLine.ParmId &&
                  parmTable.TableRefId == parmLine.TableRefId &&
                  (parmTable.ParmJobStatus == ParmJobStatus::Waiting ||
                   parmTable.ParmJobStatus == ParmJobStatus::ContainErrors);

    return [parmSubLine.ReceiveNow, parmSubLine.InventNow, parmSubLine.PdsCWInventNow];
}

