/// <summary>
///    Finds the specified <c>VendPackingSlipTrans</c> record by using a <c>SourceDocumentLine</c> record.
/// </summary>
/// <param name="_sourceDocumentLine">
///    The record ID of a <c>SourceDocumentLine</c> record to use to find a <c>VendPackingSlipTrans</c>
///    record.
/// </param>
/// <returns>
///    A record in the <c>VendPackingSlipTrans</c> table; otherwise, an empty record.
/// </returns>
public static VendPackingSlipTrans findBySourceDocumentLine(RefRecId _sourceDocumentLine)
{
    VendPackingSlipTrans     vendPackingSlipTrans;

    select firstonly vendPackingSlipTrans
        where vendPackingSlipTrans.SourceDocumentLine == _sourceDocumentLine;

    return vendPackingSlipTrans;
}

public static PurchDeviationQty_RU findDeviationQty_RU(
    VendPackingSlipJourRecId _jourRecId,
    InventLocationId         _inventLocationId = "")
{
    VendPackingSlipTrans trans;
    InventDim            inventDim;

    if (!prmisDefault(_inventLocationId))
    {
        select firstonly DeviationQty_RU, InventDimId from trans
            where trans.VendPackingSlipJour  == _jourRecId        &&
                  trans.DeviationQty_RU
        exists join inventDim
            where inventDim.InventDimId      == trans.InventDimId &&
                  inventDim.InventLocationId == _inventLocationId;
    }
    else
    {
        select firstonly DeviationQty_RU from trans
            where trans.VendPackingSlipJour  == _jourRecId        &&
                  trans.DeviationQty_RU;
    }

    return trans.DeviationQty_RU;
}

static VendPackingSlipTrans findInventTransId_RU(InventTransId  _inventTransId,
                                                 boolean        _forUpdate = false)
{
    VendPackingSlipTrans vendPackingSlipTrans;

    vendPackingSlipTrans.selectForUpdate(_forUpdate);

    select vendPackingSlipTrans
        where vendPackingSlipTrans.InventTransId == _inventTransId;

    return vendPackingSlipTrans;
}

static VendPackingSlipTrans findRecId(RecId     _recId,
                                      boolean   _forUpdate = false)
{
    VendPackingSlipTrans vendPackingSlipTrans;

    vendPackingSlipTrans.selectForUpdate(_forUpdate);

    select vendPackingSlipTrans
        where vendPackingSlipTrans.RecId == _recId;

    return vendPackingSlipTrans;
}

/// <summary>
/// Retrieves a container that contains the <c>InventNow</c> and <c>ReceiveNow</c> values of the
/// <c>VendInvoiceInfoSubLine</c> table.
/// </summary>
/// <param name="_purchId">
/// The <c>PurchID</c> value of a <c>PurchTable</c> record.
/// </param>
/// <returns>
/// A container that contains the <c>InventNow</c> and <c>ReceiveNow</c> values of the
/// <c>VendPackingSlipTrans</c> table.
/// </returns>
public static container inventAndReceiveQty(PurchIdBase _purchId)
{
    VendInvoiceInfoSubLine  vendInvoiceInfoSubLineLoc;
    VendPackingSlipTrans    vendPackingSlipTransLoc;
    VendInvoiceJour         vendInvoiceJourLoc;
    VendInvoiceTrans        vendInvoiceTransLoc;
    container               conInventReceiveQty;

    while select RecId from vendPackingSlipTransLoc
        join RecId, PurchID, InvoiceId from vendInvoiceTransLoc
        where vendInvoiceTransLoc.RecId   == vendPackingSlipTransLoc.InvoiceTransRefRecId
           && vendInvoiceTransLoc.PurchID == _purchId
        join RecId, PurchId, InvoiceId from vendInvoiceJourLoc
            where vendInvoiceJourLoc.PurchId == vendInvoiceTransLoc.PurchID
                    && vendInvoiceJourLoc.InvoiceId == vendInvoiceTransLoc.InvoiceId
    {
        select firstonly InventNow, ReceiveNow from vendInvoiceInfoSubLineLoc
            where vendInvoiceInfoSubLineLoc.JournalRefTableId == tableNum(VendPackingSlipTrans)
               && vendInvoiceInfoSubLineLoc.JournalRefRecId   == vendPackingSlipTransLoc.RecId;

        conInventReceiveQty += [vendPackingSlipTransLoc.RecId, vendInvoiceInfoSubLineLoc.InventNow, vendInvoiceInfoSubLineLoc.ReceiveNow];
    }

    return conInventReceiveQty;
}

/// <summary>
/// Retrieves the records of the <c>vendPackingSlipTrans</c> table that have a specified
/// <c>VendInvoiceTrans</c> record ID.
/// </summary>
/// <param name="_vendInvoiceTrans">
/// A <c>VendInvoiceTrans</c> record.
/// </param>
/// <returns>
/// The records of the <c>VendPackingSlipTrans</c> table that have a specified <c>VendInvoiceTrans</c>
/// record ID.
/// </returns>
static NumberOfRecords subLines(VendInvoiceTrans _vendInvoiceTrans)
{
    return (select count(RecId) from vendPackingSlipTrans
                where vendPackingSlipTrans.InvoiceTransRefRecId == _vendInvoiceTrans.RecId).RecId;
}

